import style from './Card.module.css'

export default function Card(props) {
   return (
      <div className={style.contenedor}>
         <button onClick={props.onClose}>x</button>
         <h2 className={style.nombre}>{props.name}</h2>
         <img src={props.image} alt='' />
         <h2 className={style.info}>Status: </h2><h2 className={style.info}>{props.status}</h2>
         <h2 className={style.info}>Species: </h2><h2 className={style.info}>{props.species}</h2>
         <h2 className={style.info}>Gender: </h2><h2 className={style.info}>{props.gender}</h2>
         <h2 className={style.info}>Origin: </h2><h2 className={style.info}>{props.origin}</h2>
      </div>
   );
}
